DATA_001776:
	db 'TURNER', 0x27, 'S REQUIEM  Tickets available here for Mic Turner', 0x27, 's memorial service.  All donations go towards the new Quest', 0x27, 's maiden voyage', 0x0
DATA_001777:
	db 'The Mic Turner Requiem will take place here at [MiR(Treq).  Those wishing to make a donation to the Mic Turner Requiem Fund should do so now.  Please indicate how much you would like to give:', 0x0
DATA_001778:
	db 'Thank you for your donation.  You have a seat at (row: ', 0xff, '0', 0x1, ', aisle: ', 0xff, '0', 0x2, ') in the auditorium for Mic', 0x27, 's Requiem', 0x0
DATA_001779:
	db 'Thank you.  You have reserved a place at the rear of the external auditorium from which you may be able to view the video screen if you have a powerful telescope.', 0x0
DATA_001780:
	db 'Thank you for your generosity.', 0x0
DATA_001781:
	db 'We don', 0x27, 't require further credit, you have given enough to show your  committment.  We require a Commander to re-trace Mic Turner', 0x27, 's steps in order to find out what happened.  You  are of a suitable skill level and seem to have the necessary committment.  Would you be interested in taking  on this mission?', 0x0
DATA_001782:
	db '"No. Thank you for the offer but I have enough problems on my hands without upsetting INRA."', 0x0
DATA_001783:
	db 'Fine.  No Problem.  Thank you for coming.  You have a seat at (row: ', 0xff, '0', 0x1, ', aisle: ', 0xff, '0', 0x2, ') in the auditorium for Mic', 0x27, 's Requiem.', 0x0
DATA_001784:
	db '"I', 0x27, 'll consider it.  Will it cost me anything?"', 0x0
DATA_001785:
	db 'It might.  We will credit your account with ($', 0xff, '0', 0x4, ') to help smooth the way', 0x0
DATA_001786:
	db '"What', 0x27, 's it worth?"', 0x0
DATA_001787:
	db 'We will furnish you with the Argent', 0x27, 's Quest - kitted out to the exact specs of the Turner', 0x27, 's Quest  before Mic', 0x27, 's flight.  If you don', 0x27, 't know about ', 0x27, 'Quest', 0x27, ' class ships by now, you shouldn', 0x27, 't be here.', 0x0
DATA_001788:
	db '"Yes.  I', 0x27, 'll take your offer.  What do I need to do?"', 0x0
DATA_001789:
	db 'Sell your ship in the NRS shipyard and make an offer for the Quest class ship on display there.  You will be given further information when you have collected the ship.', 0x0
DATA_001790:
	db 'Commander [Pn.  Thank you for taking this mission.', 0x0
DATA_001791:
	db 'Argents', 0xd, 'Quest', 0x0
DATA_001792:
	db 'Turners', 0xd, 'Quest', 0x0
DATA_001793:
	db '????', 0x0
DATA_001794:
	db 'You are now in possession of the ARGENT', 0x27, 'S QUEST  - the most powerful ship in the known Universe.  You must travel immediately to the last place that  Mic explored - the Hidden System at 32, 32.  We believe that the Turner', 0x27, 's Quest is still  there - you should photograph it as proof of your successful  arrival.  It is also likely that Mic', 0x27, 's Flight Recorder will be there - either in or near the ship.  Please  return it to us.  You have enough fuel to make the return journey and your weapons should ensure your survival.  Take Care.  You will make a lot of enemies this way.', 0xd, ' Please launch now. Good luck', 0x0
DATA_001795:
	db 'JOURNALIST', 0x27, 'S WELFARE FUND', 0x0
DATA_001796:
	db 'Welcome to Gateway.  If you wish to make a donation to the Kiel Newent account at the Journalist', 0x27, 's Welfare Fund, please do so now.', 0x0
DATA_001797:
	db 'Thank you.  Your generosity is much appreciated by the Galaxy', 0x27, 's investigative reporters.', 0x0
DATA_001798:
	db 'Many thanks for your generous donation.', 0x0
DATA_001799:
	db 'You were obviously a good friend of Kiel', 0x27, 's.  I', 0x27, 'm sorry not to  have met you before.  Perhaps you would like to join our new group, the Concerned Friends of Kiel Newent?  We  are attempting to find out why Kiel was killed and are currently pooling our information.', 0x0
DATA_001800:
	db '"NO.  Thank you.  I have no information that would be of value to you and I do not wish to be involved in  your affairs."', 0x0
DATA_001801:
	db 'Fair enough.  We wish you good luck in your travels.', 0x0
DATA_001802:
	db '"YES.  Thank you.  I would like to join.  Please include me on your mailing list."', 0x0
DATA_001803:
	db 'Thank you for joining CFKN.', 0x0
DATA_001804:
	db 'So far all we know is that Mic Turner was trying to locate a secret INRA  base in the northern sector - one of the co-ordinate was 32.  We have not yet found the second co-ordinate.   We also believe that the system may have an INRA defence satellite in place.', 0x0
DATA_001805:
	db 'INFORMATION FOR SALE:  I have information for sale that may be of interest to friends or colleagues of Jo Merion of Olwain.', 0x0
DATA_001806:
	db 'I have information for sale that may be of interest to friends or colleagues of Jo Merion of Olwain.', 0x0
DATA_001807:
	db '"What information do you have?"', 0x0
DATA_001808:
	db 'That', 0x27, 's none of your business.  You', 0x27, 're not a friend of Jo', 0x27, 's', 0x0
DATA_001809:
	db '"Is Jo alright?"', 0x0
DATA_001810:
	db 'Yes.  Thank you for your concern.  We spent an evening in the bar and I have some details of Mic Turner', 0x27, 's last words.  Are you interested?', 0x0
DATA_001811:
	db '"I am interested.  How much do you want?"', 0x0
DATA_001812:
	db '$50,000.', 0x0
DATA_001813:
	db '"You must be joking."', 0x0
DATA_001814:
	db 'Fine.  There are plenty of others who will pay', 0x0
DATA_001815:
	db '"OK, I', 0x27, 'll pay that."', 0x0
DATA_001816:
	db 'Thank you.', 0x0
DATA_001817:
	db 'According to Jo, Mic Turner was destroyed by a Military Defence Satellite which transmitted  the ID of the ', 0x27, 'Turner', 0x27, 's Quest', 0x27, ' to INRA.  You will need a Transmission Jammer and a Nuclear Missile to  successfully destroy the Satellite before you can safely leave the system.  The best way to get them is  to take on a secret mission from the Imperial or Federal Navy.  They will give you what you need.', 0x0
DATA_001818:
	db 'JO MERION has a message to be delivered in person to the AAAI at Alioth.  No Finance.', 0x0
DATA_001819:
	db '"I need some credit to fund the flight."', 0x0
DATA_001820:
	db 'I', 0x27, 'm sorry. A true friend of the Alliance would not require payment', 0x0
DATA_001821:
	db '"What do I get out of this?"', 0x0
DATA_001822:
	db 'The rosy glow of self-satisfaction and the knowledge of having helped the Cause.  What else?', 0x0
DATA_001823:
	db '"What', 0x27, 's the message?"', 0x0
DATA_001824:
	db 'It', 0x27, 's in this package.  You do not need to know the contents.', 0x0
DATA_001825:
	db '"When should I take the message?"', 0x0
DATA_001826:
	db 'Now.  Meredith needs to know this before Turner', 0x27, 's Requiem is held', 0x0
DATA_001827:
	db '"How do I deliver the message?"', 0x0
DATA_001828:
	db 'Go to Fortress Culloden on Argent', 0x27, 's Claim and look for the Bulletin Board announcement asking for floral deliveries.', 0x0
DATA_001829:
	db '"OK, I', 0x27, 'll take the message."', 0x0
DATA_001830:
	db 'Thank you.', 0x0
DATA_001831:
	db 'Deliver some flowers to Fortress Culloden in Alioth (0,7)  ', 0x0
DATA_001832:
	db 'FRESH FLOWERS needed to complete floral arrangements for Turner', 0x27, 's Requiem.  Best prices paid.', 0x0
DATA_001833:
	db 'I', 0x27, 'm sorry.  You do not appear to have any flowers on board.', 0x0
DATA_001834:
	db 'Thank you.  This is extremely valuable information.  You appear to be a friend  of the Alliance.  I suggest that you attend Turner', 0x27, 's Requiem and that you purchase one  of the highest class tickets, you will be well rewarded.', 0x0
DATA_001835:
	db 'And there', 0x27, 's more...', 0x0
DATA_001836:
	db 'The message you delivered from Jo Merion said that the Thargoid systems are  protected by a Military Defence Satellite.  You will need a Transmission Jammer and  a Nuclear Missile to jam it and then destroy it.  We have installed these on the  Quest.  You will need to use the Transmission Jammer to block the satellite', 0x27, 's transmission  and then use the nuclear missile to destroy it before you can safely go past.  Good Luck, Commander.', 0x0
DATA_001837:
	db 'Welcome back, Commander.  Congratulations on completing your maiden voyage.   Please dock at New Rossyth on Argent', 0x27, 's Claim so that we can service the Quest and  examine your holds.  Thank you.', 0x0
DATA_001838:
	db 'Permission refused.  Please go to New Rossyth on Argent', 0x27, 's Claim.  Thank you.', 0x0
DATA_001839:
	db 'Welcome Commander.  Please wait while we examine your cargo.', 0x0
DATA_001840:
	db 'Well done, Commander.  We will examine the photographs in detail.  In the  meantime, the flight recorder read-out has revealed the existence of a second Hidden  System.  Mic found a Thargoid Shuttle there and we believe it may still be functional.   Would you be interested in a new mission to investigate it?', 0x0
DATA_001841:
	db '"No thank you.  Life is dangerous enough as it is."', 0x0
DATA_001842:
	db 'OK.  We have credited your account with the amount agreed.  Your ship will be  returned to you now', 0x0
DATA_001843:
	db 'OK.  We have credited your account with the amount agreed plus the value of  the alien items you carried.  Your ship will be returned to you now', 0x0
DATA_001844:
	db '"What do you want me to do?"', 0x0
DATA_001845:
	db 'Take the ', 0x27, 'Argent', 0x27, 's Quest', 0x27, ' and go to the other Thargoid Front Base.  If there is a  shuttle there, it may lead you to the Thargoid home systems. If not, there may be  other useful information there that could lead us to aliens.', 0x0
DATA_001846:
	db '"What', 0x27, 's in it for me?"', 0x0
DATA_001847:
	db 'The rosy glow, no... maybe not.  There is the chance to be the first human  ever to explore the Thargoid systems.  The potential is enormous.  If you don', 0x27, 't have  the imagination to work it out, perhaps you had better not take the mission.  Oh, and  INRA will hate you forever.  This may be a massive incentive, depends on your point of view really.', 0x0
DATA_001848:
	db '"When do I have to go?"', 0x0
DATA_001849:
	db 'Now.  If you don', 0x27, 't want to do it, we have others waiting who will launch  before you', 0x27, 've fastened your seatbelt.', 0x0
DATA_001850:
	db '"OK.  I', 0x27, 'll take the mission."', 0x0
DATA_001851:
	db 'Thank you.  We have serviced the ', 0x27, 'Argent', 0x27, 's Quest', 0x27, ' and added the Nuclear  Missile and Transmission Jammer that you will need.  The second Thargoid Base is at Polaris in sector (0,76).  Please go there immediately, and return here when you  get back to human space.  Thank you.', 0x0
DATA_001852:
	db 'Visit the second Hidden System, Polaris (0,76), explore the Thargoid  Shuttle if it is there, and return to Alioth.', 0x0
DATA_001853:
	db 'CONGRATULATIONS Commander!  You have succeeded beyond our wildest expectations.   You are free to go now - the Galaxy is yours to explore as you wish.  You will be aware  that both the Federation and the Empire have outlawed you.  Take care if you approach  their systems.  The Alliance remains your friend and New Rossyth Shipyards will continue  to service your new ship whenever you require it.  Our engineers are looking at your new  Thargoid ship at this moment.  I am certain we will be able to learn a great deal from it.   THANK YOU GO IN PEACE...', 0x0
DATA_001854:
	db 'Commander [Pn, you have failed to collect Mic', 0x27, 's Flight Recorder.  This  was a major part of your mission.  You are not as competent as we had believed.  We  are prepared to allow you to retain the ', 0x27, 'Argent', 0x27, 's Quest', 0x27, ' for another, smaller mission  to rectify the gap in our knowledge.  Are you interested?', 0x0
DATA_001855:
	db '"No.  Thank you.  I', 0x27, 've had enough. I', 0x27, 'm not up to this."', 0x0
DATA_001856:
	db 'OK.  We have credited your account with the amount agreed.  Your ship  will be returned to you now', 0x0
DATA_001857:
	db 'OK.  We have credited your account with the amount agreed plus  the value of the alien items you carried.  Your ship will be returned to you now', 0x0
DATA_001858:
	db '"Yes please.  I', 0x27, 'll take the mission."', 0x0
DATA_001859:
	db 'Good.  You have a chance to redeem yourself.  INRA have a Northern base  on Liaethfa at sector co-ordinates (0,7).  We have an agent on Gold who  requires urgent pick-up.  Go to Werner Starport and look on the Bulletin Board for an  advert relating to floral arrangements.  If the code colour is RED, answer the ad.   If it is GREEN, leave immediately and return here.  Please leave now.', 0x0
DATA_001860:
	db 'INTERGALACTIC FLORA AND FAUNA INC has an urgent delivery of Old English  Roses to be made to before tomorrow to a relative in Red Square.  All options considered.', 0x0
DATA_001861:
	db 'Thank you.  My cousins will be most grateful.  Your ship ID suggests  that you come from Alioth.  Co-incidentally, that is where the delivery must be  made.  Will you take it?', 0x0
DATA_001862:
	db '"No.  I', 0x27, 'm sorry, this is too dangerous."', 0x0
DATA_001863:
	db 'I suggest you reconsider.  If I', 0x27, 'm going down, you', 0x27, 're coming with me.   INRA will be watching your ship by now.', 0x0
DATA_001864:
	db '"What do you want me to do?"', 0x0
DATA_001865:
	db 'Take me back to New Rossyth - NOW!  This place is lethal.', 0x0
DATA_001866:
	db '"OK, I', 0x27, 'll take the delivery."', 0x0
DATA_001867:
	db 'Thank you.  I suggest we move out of here as fast as this thing will go.', 0x0
DATA_001868:
	db 'Drop off the agent at New Rossyth.', 0x0
DATA_001869:
	db 'Commander [Pn.  You are under arrest on charges of espionage and high treason.   You will be held in custody until your trial which is scheduled sometime next century.  Good bye.', 0x0
DATA_001870:
	db 'Welcome back Commander.  Please dock at New Rossyth so that we can unload the Argent', 0x27, 's Quest.', 0x0
DATA_001871:
	db 'Thank you Commander.  Please wait while we debrief your passenger.', 0x0
DATA_001872:
	db 'Commander [Pn, our agent has recovered the log from Mic', 0x27, 's Escape Capsule.   Apparently Mic found another Hidden System with a Thargoid Shuttle and we believe  it may still be functional.  Would you be interested in a new mission to investigate it?', 0x0
DATA_001873:
	db 'Commander [Pn, you have failed irredeemably.  We will pay you half  of the agreed amount and return your old ship.  Please leave immediately.', 0x0
DATA_001874:
	db 'Commander [Pn, you are trespassing on military territory, leave immediately.', 0x0
DATA_001875:
	db 'Commander [Pn, you have entered a military restricted zone.', 0x0
DATA_001876:
	db 'Incoming message from INRA Counter Intelligence Wing.  Message reads:  Military Commander [Pn,  we have reason to believe that you may be considering a self-funded expedition to previously uncharted  areas of the Galaxy.  It is, of course, every citizen', 0x27, 's statutory right to conduct their own affairs  without interference.  We believe, however, that we may have certain interests in common and that you may  wish to consider a joint approach.  Particularly, we believe that you may require further funding for your  venture.  We will pay you to make a delivery on our behalf.', 0x0
DATA_001877:
	db '"What do I need to do?"', 0x0
DATA_001878:
	db 'We believe that you are about to visit some distant acquaintances of ours.  We wish you to deliver a container to them.', 0x0
DATA_001879:
	db '"Sorry, I don', 0x27, 't make deliveries."', 0x0
DATA_001880:
	db 'We strongly advise you to reconsider.  Terrorist status can prove deeply inconvenient, even to a Commander of your calibre.', 0x0
DATA_001881:
	db '"What am I delivering?"', 0x0
DATA_001882:
	db 'An improved variation of a previous gift.  This version has undergone significant development since the delivery of its predecessor.', 0x0
DATA_001883:
	db '"Will your acquaintances wish to receive this delivery?"', 0x0
DATA_001884:
	db 'Dream on, Commander. ', 0x0
DATA_001885:
	db '"Will I be carrying anything infectious?"', 0x0
DATA_001886:
	db 'No Comment', 0x0
DATA_001887:
	db '"How much are you offering?"', 0x0
DATA_001888:
	db '$100,000 will be added to your credit rating on acceptance of the offer.  A similar amount will  await you on your return.  We will also allow you to trade in any goods you may acquire en route and will  not exact any customs levies on your return.', 0x0
DATA_001889:
	db '"There is the small matter of my legal record?"', 0x0
DATA_001890:
	db 'All records will have been revised in your favour by the time you get back.  In addition, you will be elevated to the highest  possible status.  On your successful return, you will be accorded a HERO', 0x27, 's welcome with full Military Honours  within the areas of Federal and Imperial edict.', 0x0
DATA_001891:
	db '"OK,I accept your offer."', 0x0
DATA_001892:
	db 'A wise decision.  The container is loading and a credit transfer has been made to your account.  The  cylinder fits in your missile rack and will launch on command.  We suggest that you leave the system  immediately on launching.  Good hunting.', 0x0
DATA_001893:
	db 'Thargoid Clone Leader to Followers: All drive engines destroyed.  Hyperspace no  longer possible.  All followers withdraw to Forward Base 2.  This ship highly infectious.   Clone members preparing to die.  Do not attempt to board.  Repeat, do not attempt to board.', 0x0
DATA_001894:
	db 'Incoming message from Thargoid Clone Leader.  Message reads:', 0xd, ' Thargoid Clone Leader to human ship.  We fire only in self-defence.  If you  agree to our demands you will be safe in Thargoid space.  Please dock in our  Leader Ship so that we may disarm your ship.    Message ends.', 0x0
DATA_001895:
	db 'Incoming message from Thargoid Clone Leader.  Message reads:', 0xd, ' Thargoid Clone Leader to human ship.  Thank you.  Disarming is complete.   We will return your weapons on termination of our negotiations.    Message ends.', 0x0
DATA_001896:
	db 'Incoming message from Thargoid Clone Leader:  You have been to  Pleione and Polaris.  We believe that you are here for personal gain and  wish to make you an offer that it will be in your best interests to accept.   If you do not wish to consider our offer, you may request launch as usual and  we will release your ship.  You should depart immediately before the ', 0x27, 'Argent', 0x27, 's  Quest', 0x27, ' becomes terminally infected with the INRA mycoid.  If you intend to stay  and accept our offer, please click ', 0x27, 'YES', 0x27, '.    Message ends.', 0x0
DATA_001897:
	db 'YES', 0x0
DATA_001898:
	db 'NO', 0x0
DATA_001899:
	db 'Incoming message from Thargoid Clone Leader:  Thank you for your trust in us.   Our proposal is this:  We require the Vaccine to combat the effects of the engineered micro-organism  which is infecting our ships and our systems.  We know that it exists in large stocks in underground  bunkers on the INRA research base at the planet Hotice1 in the system of that name at co-ordinates  (-3,-2) measured from the zero point of your star Sol.  We request that you travel there and recover the stocks. If you accept, we will provide you with the equipment required to life the stocks from the bunkers  and we will also replace your weapons with others of significantly enhanced fire power to increase  your chances of surviving both legs of the journey.  If you succeed, we will give you, on your return, a Thargoid War Ship plus access to other areas  of our technology and the friendship in perpetuity of the Thargoid race. If you wish to accept out offer, please indicate as before.  Message ends.', 0x0
DATA_001900:
	db 'We regret that now you know our weakness, you cannot be allowed to leave  here.  Your decision is regrettable.  Go to your gods in peace.', 0x0
DATA_001901:
	db 'Incoming message from Thargoid Clone Leader:  Thank you.  Your ship has  been equipped with a Thargoid Laser and a rack of Thargoid missiles.  These are far  superior to those with which you were previously armed although none of them contain  nuclear warheads and will not extend their damage beyond the area targeted.  The  mining machine will collect Vaccine if you drop it onto a breached bunker.', 0xd, ' You may launch safely now and should leave our systems immediately to avoid  contamination.  If you return with the Vaccine, you will be made most welcome.  Go in peace.  Message ends.', 0x0
DATA_001902:
	db 'GOOD LUCK COMMANDER', 0x0
DATA_001903:
	db 'Incoming Message from Thargoid Clone Leader:  Congratulations Commander.   You are indeed a consummate warrior.  Please dock with our ship as before.  Message ends.', 0x0
DATA_001904:
	db 'Incoming Message from Thargoid Clone Leader:   Please dock with our ship as before.  Message ends.', 0x0
DATA_001905:
	db 'Incoming Message from Thargoid Clone Leader:  Thank you.  You have  succeeded beyond our expectations.  If you will wait briefly, we will unload your  ship and examine the cargo.  Message ends.', 0x0
DATA_001906:
	db 'Incoming Message from Thargoid Clone Leader:  Your mission has been  one hundred per cent successful Commander.  We are in your debt.  If you wish to wait,  we will create for you a modified Thargoid War Ship that will far exceed anything you  have ever commanded in drive power and  military capabilities.  It will take some time  to create a ship that is free of infection and we suggest that you enter your altered  time state to reduce the tedium of the wait.', 0xd, ' Alternatively, if you wish to leave us immediately, you may request launch now and  we will furnish your ship with items which, if traded will bring you untold wealth.   Please indicate as before if you wish to stay with us and collect the war ship.  Message ends.', 0x0
DATA_001907:
	db 'Incoming Message from Thargoid Clone Leader: Welcome aboard your new  ship, Commander.  It will respond to similar commands as your previous ship although  there are some changes which you will discover as you progress.  Your cargo hold  contains goods which will bring you inestimable wealth  on your trading market.  We will follow you now to your own systems and will attempt to  negotiate with those who sent you here.  We suggest that you launch now and return to your home worlds.  Message ends.', 0x0
DATA_001908:
	db 'Incoming Message from Thargoid Clone Leader:  If you wish to return to  us at any point, you will be made an honoured guest and we would welcome trade with  you.   We regard you as an ally and offer the help and protection of our people whenever  we meet. Go in Peace Commander.  Message ends.', 0x0
DATA_001909:
	db 'Incoming Message from Thargoid Clone Leader:  Thank you Commander.   We are grateful for your self-restraint.  The updated mycoid will be useful to us  in the development of further vaccine of our own.  We are in your debt.  If you wish  to wait, we will create for you a modified Thargoid War Ship that will far exceed  anything you have ever commanded in drive power and  military capabilities.  It will  take some time to create a ship that is free of infection and we suggest that you  enter your altered time state to reduce the tedium of the wait.', 0xd, ' Alternatively, if you wish to leave us immediately, you may request launch now and  we will furnish your ship with items which, if traded will bring you untold wealth.   Please indicate as before if you wish to stay with us and collect the war ship.  Message ends.', 0x0
DATA_001910:
	db 'Incoming Message from Thargoid Clone Leader:  Commander, it appears to  us that you were successful in your collection of the Vaccine but have mislaid it since  leaving the INRA world.  Is this correct?  Message ends.', 0x0
DATA_001911:
	db 'Incoming Message from Thargoid Clone Leader:  We have fitted your ship  with a tracking device which will enable you to find the ship which removed the Vaccine.   We suggest that you engage it in combat and use your tractor beam cargo scoop to retrieve  the debris when you have destroyed our enemy.  Do not return again empty handed.  Please launch now.  Message ends.', 0x0
DATA_001912:
	db 'Incoming Message from Thargoid Clone Leader:  Commander,  you have failed  us.  This is most regrettable.  Go to your gods in peace. Message ends.', 0x0
DATA_001913:
	db 'Incoming Message from Thargoid Clone Leader:  Commander.  You have  failed.  We will release you on the condition that you try again.  Please return  directly to Hotice1 in the system of Hotice at co-ordinates (-3,-2) and use our missiles  to destroy the bunker containing the stocks of vaccine.  The mining machine that we gave  you will be able to collect the vaccine although you will have to land to pick it up.   INRA will be waiting but you can outfight them or outfly them with the ship that you  have.  Please launch now. Message ends.', 0x0
