DATA_007147:
	db 'Famous as the first true corporate system. The Sirius corporation has been using the vast amounts of cheap energy available on Lucifer from coils wrapped around the planet for synthesis of custom elements (particularly military grade fuel) since 2350 and the first interstellar war.', 0xd, 'This system is not subject to Federal law.', 0x0
DATA_007148:
	db 0x20, 0x0
DATA_007149:
	db 'Landfall has one of the most interesting skies of all the known habitable planets, with no less than six stars bright enough to cast shadows at some time.', 0xd, 'It also has the best preserved indigenous wildlife which cohabits succesfully, often to the exclusion of introduced life.', 0x0
DATA_007150:
	db 0x20, 0x0
DATA_007151:
	db 'Very high humidity and native life make this an interesting place to visit. Many exotic food stuffs are grown here. The scenery is strikingly beautiful, though the wildlife can be a little dangerous.', 0x0
DATA_007152:
	db 'Only just sustaining life, the indigenous forms on this arid planet are very hardy.', 0x0
DATA_007153:
	db 'This system was given to the Guardians of the Free Spirit religious sect by the Federation in 2480. They believe in maximum hardship and live underground on several of the inner planets of the system. It is forbidden by Federal Law to enter the system without the permission of the Guardians.', 0x0
DATA_007154:
	db 'Famous as the first flare star system to be settled, in 3017. All surface habitations have flare shelters beneath them, which should be entered on hearing the flare warnings. The first planet, often known as Lenin, was terraformed by a group of rich idealists on condition it was run to strict communist principles. They endowed an enormous amount of wealth to the system, which is now very rich.', 0x0
DATA_007155:
	db 'Prisoners are housed in underground cell complexes, and set to do manual mining work. Visitors are allowed, but an entry permit must first be obtained.', 0xd, ' There is reputed to be a seedier side to the colony whereby lonely visitors may enter without a permit while the guards turn a blind eye for a fee, but this is always denied.', 0x0
DATA_007156:
	db 0x20, 0x0
DATA_007157:
	db 'Eden was the first planet on which liquid water was detected, by spectroscopic methods in 2038, and so was a major driving force for the exploration of space. However, Eden turned out to be extremely inhospitable with the added danger of hard radiation from Proxima. There is now a small research station on Eden, but little else in the rest of the system.', 0x0
DATA_007158:
	db 'Vast areas are used for growing custom grain crops in enormous quantities which are then exported to the surrounding worlds.No manufacturing industry is permitted to avoid any polluting emmisions.', 0x0
DATA_007159:
	db 'The inner planet was terraformed by the Cisco corporation into a beautiful theme park in 2958. The system does not come under Federal law, and a wide range of exotic delights are available, including historic adventures staged using actors.', 0x0
DATA_007160:
	db 'The planet Scott was terraformed in 2329 as an agricultural colony, but the temperature could not be sustained and was abandoned in 2408 after a disease epidemic. The equatorial belt was resettled in 2641 by settlers who liked the harsh environment, now famous for fishing and tourism. It is particularly popular with the industrial workers from nearby systems who otherwise live their whole lives indoors.', 0x0
DATA_007161:
	db 'Two planets here have now been terraformed, and both are largely given over to agricultural production and to ethically questionable cattle ranching. There is little manufacturing industry other than the production of the famous bourbon.', 0x0
DATA_007162:
	db 0x20, 0x0
DATA_007163:
	db 'First colony outside the Sol system, and first alien life was discovered here. Unfortunately the last remnants are now in zoo enclosures for tourists, introduced life and crops cover most of the surface and seas.', 0x0
DATA_007164:
	db 'Early life had just started to emerge on Arcturus 3 when the human settlers arrived in 2304. This has now been replaced by an Earth ecosystem, adapted to live under the red light. Locals are generally confident their star will remain a red giant forever.', 0x0
DATA_007165:
	db 'Historic system famous as both the birthplace of Humanity and as the political capital of the Federation. A very expensive and prestigious system to live in, and a popular tourist venue. Most rich humans will visit Earth once in their lives. All the major corporations have their headquarters on Mars, terraformed in 2286, which is the main centre for administration.', 0x0
DATA_007166:
	db 'Imperial capital on Achenar 6d, known as Capitol by the locals. 6c is still known as Conversion though it was terraformed in 2696. 6b was terraformed in 2850 to accomodate the population explosion which followed. Anyone without the quirky accent of Imperial citizens is shunned, especially if they are from a Federation world.', 0x0
