DATA_007168:
	db 'The deep and highly mechanised Imperial mines are renowned for their efficiency at ore extraction. Slavery is also important for the routine supervision of the machinery in the unpleasant mining environment.', 0x0
DATA_007169:
	db 'Many Imperial worlds were terraformed during the last major Imperial expansion 2950-3150, including this, and there are numerous fine examples of architecture of the period.', 0x0
DATA_007170:
	db 0x20, 0x0
DATA_007171:
	db 0x20, 0x0
DATA_007172:
	db 'There is no real law here, though in the cities organised crime does some form of policing. It is highly recommended to avoid this system if at all possible.', 0x0
DATA_007173:
	db 0x20, 0x0
DATA_007174:
	db 'Well known Imperial Naval Base. Most Imperial naval administration is done on Topaz, and there are several outdoor training camps across the surface.', 0x0
DATA_007175:
	db 'The main Federal Naval Base was moved here from Anlave in 2983 following terraforming in the 2970s, and is an excellent training ground for planetary assault troops.', 0x0
DATA_007176:
	db 'System most famous for the giant Verrix. Stevenson is the home world of the hardy beast of burden now found throughout human space, especially on the emerging worlds of the outer rim.', 0x0
DATA_007177:
	db 'The Industrialised worlds of the Alliance are well known for the far better conditions available for workers than elsewhere.', 0x0
DATA_007178:
	db 'The now famous capital of the Alliance of Independent Systems. This system was the subject of many battles between the Federation and the Empire over many years, until in 3230 the Alliance was formed in a massed insurrection against both sets of invaders.', 0xd, 'The Alliance has now spread over many worlds, and so Alioth is now an important political centre.', 0x0
